static char *
match_delim(CommandPart *cp, char *str)
{
	int i;
	int len;

	if (!cp || !cp->delim)
		return 0;

	len = strcspn(str, " \t\n");

	for(i=0; i<cp->delim->count; i++)
	{
		int l;
		char *s = (char*) cp->delim->items[i];
		l = strlen(s);
		if ( l == len && !strncasecmp(s, str, l))
			return s;
	}

	return 0;
}

